import React from "react";
import { View, Text } from "react-native";

const AccountScreen = () => {
  return (
    <View style={{ flex: 1, justifyContent: "center", alignItems: "center" }}>
      <Text>Wellcome to Dashboard</Text>
    </View>
  );
};

export default AccountScreen;
